function Header() {
  const client = "Designer";

  const title = {
    designer: "Design",
    progrmmer: "Progrmming",
  };

  const info = {
    name: "Rami",
    nick: "Kuteish",
  };

  return (
    <div className="text-white navbar bg-dark rounded">
      Hello {`${info.name} ${info.nick}`}
      <h2>
        {client === "Designer" ? title.designer : title.progrmmer} is my life.
      </h2>
      ;
    </div>
  );
}
export default Header;
